import React from 'react'
import { CITY_OPTIONS } from '../../../constants/global'

function Citys() {
    const citys = CITY_OPTIONS
    return (
        <div className="flex flex-row">
            {citys.map((city) => {
                return(
                    <p>
                        {city.label}
                    </p>
                )
            })}
        </div>
    )
}

export default Citys;
